        </h4>
        <span class="media-label">Jul 19, 2016</span>
        <div class="media-content">
            <p>गत आर्थिक बर्षको चौथो त्रैमास सकिएर बैंक तथा बित्तीय संस्थाहरुले धमाधम बित्तीय बिबरण प्रकाशित गर्ने तयारी गर्दा कुन बाणिज्य &nbsp;बैंकले कति कमायो भन्ने चासो पनि लगानीकर्तामा बढ्दो छ । लगानीकर्ताको यही चासोलाई सम्बोधन गर्दै मेरोलगानी डटकमले बैंकका अधिकारीहरुसँगको अनौपचारिक कुराकानीमा आधारित यो आँकलन प्रस्तुत गरेको छ ।</p>
        </div>
    </div>
</div>
