    <div class="media-body">
        <h4 class="media-title">
            <a href="/NewsDetail.aspx?newsID=27478">ग्रीन डेभलपमेण्ट बैंकको साधारण शेयर आइतबारदेखि बिक्री खुल्ला, कति रकमको आवेदन गर्ने ?</a>
        </h4>
        <span class="media-label">Jun 03, 2016</span>
        <div class="media-content">
            <p>ग्रीन डेभलपमेण्ट बैंकले जेठ २३ गते आइतबारदेखि साधारण शेयर निष्काशन गर्दैछ । साधारण शेयर निष्काशनको क्रम बाक्लिंदै गर्दा ग्रीन डेभलपमेण्ट बैंकले पनि शेयर निष्काशन गरेको हो । झण्डै ४ साता अघि धितोपत्र बोर्डबाट शेयर निष्काशनको स्वीकृति पाएको बैंकले ४ करोड ५० लाख रुपैंया बराबरको ४ लाख ५० हजार कित्ता शेयर निष्काशन गरेको हो ।</p>
